import React, { Component } from 'react';


class Form3 extends Component {


    render() {
        return (
            <div>
            <div>
            <h1>Pioneers info</h1>
            <div className="field">
              <label>  Pioneers name </label>
              <input class="input" type="text" placeholder="Enter pioneer name" />
            </div>
            <div className="field">
              <label> Refs no </label>
              <input class="input" type="text" placeholder="Enter Refs no" />
            </div>
            <div className="field">
              <label> Cell no </label>
              <input class="input" type="text" placeholder="Enter Email" />
            </div>
            <div className="field">
              <label> Counter </label>
              <input class="input" type="text" placeholder="Enter Contacts" />
            </div>
          </div>

            </div>
        );
    }
}

Form3.propTypes = {

};

export default Form3;
